package com.stringmethods;

public class ToCharArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		String data="Welcome to testing masters";
		
		
		char[] arr=data.toCharArray();
		
		for (char c : arr) {
			System.out.println(c);
		}
		
		
		
		

	}

}
